CREATE TABLE [dbo].[country] (
    [ID]                 INT            IDENTITY (1, 1) NOT NULL,
    [iso2]               VARCHAR (2)    NOT NULL,
    [country_name]       NVARCHAR (100) NOT NULL,
    [iso3]               VARCHAR (3)    NOT NULL,
    [capital]            NVARCHAR (100) NULL,
    [area]               INT            NULL,
    [country_population] BIGINT         NULL,
    [currency]           NVARCHAR (3)   NULL,
    [languages]          NVARCHAR (100) NULL,
    CONSTRAINT [PK_country] PRIMARY KEY CLUSTERED ([ID] ASC)
);

CREATE TABLE [dbo].[continent] (
    [ID]             VARCHAR (2)   NOT NULL,
    [continent_name] NVARCHAR (20) NOT NULL,
    CONSTRAINT [PK_continent] PRIMARY KEY CLUSTERED ([ID] ASC)
);

CREATE TABLE [dbo].[country_continent_link] (
    [country_ID]   INT         NOT NULL,
    [continent_ID] VARCHAR (2) NOT NULL,
    CONSTRAINT [PK_country_continent_link] PRIMARY KEY CLUSTERED ([continent_ID] ASC, [country_ID] ASC),
    CONSTRAINT [FK_country_on_continent] FOREIGN KEY ([continent_ID]) REFERENCES [dbo].[continent] ([ID]),
    CONSTRAINT [FK_continent_has_country] FOREIGN KEY ([country_ID]) REFERENCES [dbo].[country] ([ID]) ON DELETE CASCADE
);

SET IDENTITY_INSERT [dbo].[country] ON
SET IDENTITY_INSERT [dbo].[country] OFF


